class Factory {
    
    static async init(content, manager) {
        return await Factory_init(content, manager);
    }
    
    static async fromInit(content, manager) {
        const init = await Factory_init(content, manager);
        const address = contractAddress(0, init);
        return new Factory(address, init);
    }
    
    static fromAddress(address) {
        return new Factory(address);
    }
    
    address; 
    init;
    abi = {
        types:  Factory_types,
        getters: Factory_getters,
        receivers: Factory_receivers,
        errors: Factory_errors,
    };
    
    constructor(address, init) {
        this.address = address;
        this.init = init;
    }
    
    async getGetPair(provider, tokenA, tokenB) {
        let builder = new TupleBuilder();
        builder.writeAddress(tokenA);
        builder.writeAddress(tokenB);
        let source = (await provider.get('get_pair', builder.build())).stack;
        let result = source.readAddress();
        return result;
    }
    
}

